import { useState } from 'react';
import './App.css';
import SearchMovies from './SearchMovies';

function App() {
  const [favourites, setFavourites] = useState([]);

  const addFavourite = (movie) => {
    setFavourites([...favourites, movie]);
  }
  return (
    <div className="App">
      <SearchMovies addFavourite/>
    </div>
  );
}

export default App;
